import React from "react";
import "./TablaCocheras.css";
import { FaEdit, FaTrashAlt } from "react-icons/fa";
import CocherasData from "../../config/cocherasData"; // Ruta corregida

const TablaCocheras = () => {
    const getEstadoClass = (estado) => {
        return estado === "Disponible" ? "estado-disponible" : "estado-ocupada";
    };

    return (
        <div className="table-container">
            <table className="table">
                <thead>
                <tr>
                    <th>ID Cochera</th>
                    <th>Número de Cochera</th>
                    <th>Ubicación</th>
                    <th>Estado</th>
                    <th>Asignada a</th>
                    <th>Acciones</th>
                </tr>
                </thead>
                <tbody>
                {Array.isArray(CocherasData) && CocherasData.length > 0 ? (
                    CocherasData.map((cochera) => (
                        <tr key={cochera.id}>
                            <td>{cochera.id}</td>
                            <td>{cochera.numero}</td>
                            <td>{cochera.ubicacion}</td>
                            <td>
                                    <span className={`estado ${getEstadoClass(cochera.estado)}`}>
                                        {cochera.estado}
                                    </span>
                            </td>
                            <td>{cochera.asignada}</td>
                            <td>
                                <button
                                    className="edit-button"
                                    aria-label={`Editar cochera ${cochera.id}`}
                                >
                                    <FaEdit />
                                </button>
                                <button
                                    className="delete-button"
                                    aria-label={`Eliminar cochera ${cochera.id}`}
                                >
                                    <FaTrashAlt />
                                </button>
                            </td>
                        </tr>
                    ))
                ) : (
                    <tr>
                        <td colSpan="6" className="no-data">
                            No hay cocheras disponibles.
                        </td>
                    </tr>
                )}
                </tbody>
            </table>
        </div>
    );
};

export default TablaCocheras;
